src/VotingContract.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity 0.8.17;

contract Vote {
    mapping(string => uint256) votes;
    mapping(string => VoterDetail) votingMachine;
    struct VoterDetail {
        string voterId;
        string votedTo;
    }

    function giveVote(VoterDetail memory voterDetail)
        public
    {
        votingMachine[voterDetail.voterId] = voterDetail;
    }
}

